import React from 'react';

const PeopleCard = ({name, gender, height, mass}) =>{

	return(

		<div>

		<p>{name}</p>
		<p>{gender}</p>
		<p>{height}</p>
		<p>{mass}</p>

		</div>

		);
}


export default PeopleCard
